import './App.css';
import { motion } from "framer-motion"; 
import { BsFillArrowLeftCircleFill } from "react-icons/bs";

function Nav() {
  return (
    <div className="right-sidebar">
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
      </ul>
    </div>
  );
}


function App() {

  return (

    <div className='nav'>
        <motion.div animate={{x:-500}} className="box"> </motion.div>
        <btn class="menubtn" onClick={Nav}>

          <BsFillArrowLeftCircleFill className='menuicon'onClick={Nav}/>

        </btn>
    </div>
  );
}


export default App;
